import "./news.css";
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay } from 'swiper/modules';
import "swiper/css";

function News() {

    return (
        <div className='news'>
            <div className='news-container'>
                <div className='new-container-left'>
                    <div className='big-new-image'></div>
                    <div className='big-new'></div>
                    <div className='big-new-title glitch2' data-content='GIVE YOUR SECRETLAB TITAN EVO A NEW LOOK WITH THE SECRETLAB SKINS CYBERPUNK: EDGERUNNERS COLLECTION'>
                        GIVE YOUR SECRETLAB TITAN EVO A NEW LOOK WITH THE SECRETLAB SKINS CYBERPUNK: EDGERUNNERS COLLECTION
                    </div>
                </div>
                <div className='new-container-right'>
                    <div className='mySwiper'>
                        <Swiper
                            spaceBetween={50}
                            slidesPerView={1}   
                            loop={true}
                            autoplay={{
                                delay: 500,
                                disableOnInteraction: true,
                            }}
                            modules={[Autoplay]}
                        >
                            <SwiperSlide><div className='itm'>ITEM1</div></SwiperSlide>
                            <SwiperSlide><div className='itm'>ITEM2</div></SwiperSlide>
                            <SwiperSlide><div className='itm'>ITEM3</div></SwiperSlide>
                        </Swiper>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default News;
